<body lang="EN-US" link="#0563C1" vlink="#954F72">
<div class="WordSection1">
<p class="MsoNormal">Dear All, </p>
<p class="MsoNormal">&nbsp;</p>
<p class="MsoNormal">My apologies that we couldnt carry out the session the last time. Lets have a quick discussion on the room allocation for tooling.</p>
<p class="MsoNormal">&nbsp;</p>
<p class="MsoNormal">Dear Anis/Saif, </p>
<p class="MsoNormal">&nbsp;</p>
<p class="MsoNormal">Ive extended the invitation to you as I think this would also be related for you.
</p>
<p class="MsoNormal">The initial idea of the discussion is to find a location for the ENG NPI Tooling room, however after our discussion yesterday we may need another room for you as well.
</p>
<p class="MsoNormal">Please feel free to join. </p>
<p class="MsoNormal">&nbsp;</p>
<p class="MsoNormal">Thank you. </p>
<p class="MsoNormal">&nbsp;</p>
<p class="MsoNormal">Best regards, </p>
<p class="MsoNormal">Gaya</p>
<p class="MsoNormal">&nbsp;</p>
<p class="MsoNormal">&nbsp;</p>
<p class="MsoNormal">**Moved the session, as requested</p>
<p class="MsoNormal">&nbsp;</p>
<p class="MsoNormal">Dear All  my sincere apology, I need to reschedule due to urgent task</p>
<p class="MsoNormal">&nbsp;</p>
<p class="MsoNormal">Hello All,</p>
<p class="MsoNormal">&nbsp;</p>
<p class="MsoNormal">Attached email referred. </p>
<p class="MsoNormal">Appreciate if you could spare some time for us to discuss on the tooling room.</p>
<p class="MsoNormal">&nbsp;</p>
<p class="MsoNormal">Hello Vijay, </p>
<p class="MsoNormal">&nbsp;</p>
<p class="MsoNormal">I am including you in the discussion to understand if theres any constraint from maintenance point of view with the tooling room selection.
</p>
<p class="MsoNormal">&nbsp;</p>
<p class="MsoNormal">If you are not available at the aforesaid hour, please feel free to propose the timing.
</p>
<p class="MsoNormal">&nbsp;</p>
<p class="MsoNormal">Thank you. </p>
<p class="MsoNormal">&nbsp;</p>
<p class="MsoNormal">Best regards, </p>
<p class="MsoNormal">Gaya</p>
</div>
</body>
</html>
