<div class="WordSection1">
<p class="MsoNormal"><span lang="EN-US">Dear all,</span></p>
<p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p>
<p class="MsoNormal"><span lang="EN-US">I will cancel this session and make a separate session for each section.</span></p>
<p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p>
<p class="MsoNormal"><span lang="EN-US">-----------------</span></p>
<p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p>
<p class="MsoNormal"><span lang="EN-US">Hi production leaders,</span></p>
<p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p>
<p class="MsoNormal"><span lang="EN-US">We would like to call for a kick off of tool sticker replacement activity.</span></p>
<p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p>
<p class="MsoNormal"><span lang="EN-US">Hi Metrology team,</span></p>
<p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p>
<p class="MsoNormal"><span lang="EN-US">As commit earlier, please hand over the stickers to Saif or me by this Friday, 15 July 2022. Feel free to have one representative (or more) during this kick off if theres any further question from production team.</span></p>
<p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p>
<p class="MsoNormal"><span lang="EN-US">Regards,</span></p>
<p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p>
<p class="MsoNormal"><span lang="EN-US">Anis Omar</span></p>
<p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p>
<p class="MsoNormal"><span style=""><img data-imagetype="AttachmentByCid" originalSrc="cid:image001.png@01D895D0.B4F79410" src="cid:image001.png@01D895D0.B4F79410" width="586" height="295" id="Picture_x0020_1" alt="cid:image001.png@01D895D0.B4F79410" style="width:6.1041in; height:3.0729in"></span><span lang="EN-US"></span></p>
</div>
</body>
