<p class="MsoNormal"><span lang="EN-US">Hi all,</span></p>
<p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p>
<p class="MsoNormal"><span lang="EN-US">As all of you aware, we are now sending bulks of NC tools for repair and fabrication. However the direction on the verification process upon repair is unclear for us from production.</span></p>
<p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p>
<p class="MsoNormal"><span lang="EN-US">This meeting is set to discuss and get an agreement with all parties on this matter.</span></p>
<p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p>
<p class="MsoNormal"><span lang="EN-US">Appreciate if all of you can be available for this discussion.</span></p>
<p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p>
<p class="MsoNormal"><span style=""><img data-imagetype="AttachmentByCid" originalSrc="cid:image001.png@01D8A004.2D8C4370" src="cid:image001.png@01D8A004.2D8C4370" width="579" height="236" id="Picture_x0020_1" alt="cid:image001.png@01D8A004.2D8C4370" style="width:6.0312in; height:2.4583in"></span><span lang="EN-US"></span></p>
<p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p>
<p class="MsoNormal"><span lang="EN-US">Regards,</span></p>
<p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p>
<p class="MsoNormal"><span lang="EN-US">Anis Omar</span></p>
<p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p>
<p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p>
